var app=angular.module("ngOutpost",[]);app.constant("ngOutpostApp",{VERSION:"0.6.0"}),app.factory("NgOutpostFactory","$http","APP",function(a,b){var c={};return c.getMessages=function(c){return a.post("http://outpost.mulleravenue.com/api/get/message",{api_key:b.API_KEY})},c.createMessage=function(c){return a.post("http://outpost.mulleravenue.com/api/create/message",{api_key:b.API_KEY,source:c.source,app_name:b.APP_NAME,from_name:c.from_name,from_email:c.from_email,subject:c.subject,body:c.body})},c.deleteMessage=function(c){return a.post("http://outpost.mulleravenue.com/api/delete/message",{api_key:b.API_KEY,mid:c.mid})},c});